import React, { Component } from "react";
import Axios from "axios";
import { Redirect } from "react-router-dom";
import swal from "sweetalert";

class CompanyViewJobs extends Component {
  constructor(props) {
    super(props);
    this.state = { events: [], redirector: null, registeredstudents: "" };
    this.startfunc = this.startfunc.bind(this);
    this.onClickHandler = this.onClickHandler.bind(this);
  }

  startfunc() {
    //event.preventDefault();
    let email = localStorage.getItem("email");
    Axios.post("http://127.0.0.1:4001/companyviewjobs", {
      companyemail: email
    })
      .then(data => {
        //console.log(data);
        this.setState({
          events: data.data
        });
        console.log(this.state.events[0]);
      })
      .catch(err => {
        console.log(err);
      });
  }

  render() {
    return <div>JOBs Added by this company</div>;
  }
}

export default CompanyViewJobs;
